CREATE TABLE `events` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) NOT NULL,
  `description` text,
  `charges` text,
  `detention_date` date NOT NULL,
  `release_date` date DEFAULT NULL,
  `report_date` date NOT NULL,
  `psych_assist` tinyint(1) NOT NULL,
  `material_assist` tinyint(1) NOT NULL,
  `consequences` text,
  `was_activist` tinyint(1) NOT NULL,
  `victim_is_complainant` tinyint(1) NOT NULL,
  `allow_storage` tinyint(1) NOT NULL,
  `allow_publishing` tinyint(1) NOT NULL,
  `allow_representation` tinyint(1) NOT NULL,
  `data_is_sensitive` tinyint(1) NOT NULL,
  `report_id` bigint(20) DEFAULT NULL,
  `owner_id` bigint(20) NOT NULL,
  `public` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `report_id` (`report_id`),
  KEY `owner_id` (`owner_id`),
  CONSTRAINT `events_ibfk_1` FOREIGN KEY (`report_id`) REFERENCES `reports` (`id`),
  CONSTRAINT `events_ibfk_2` FOREIGN KEY (`owner_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=902 DEFAULT CHARSET=latin1;
